INSERT INTO `texte_encart` VALUES (1,'<p>Les archives du groupe&nbsp;sont stock&eacute;es sur un volume d&eacute;di&eacute; &agrave; <u><strong>Nantes</strong></u>. (et en lecture seule)<br />\nPour plus de s&eacute;curit&eacute;, ces donn&eacute;es sont dupliqu&eacute;es sur le site de Bron.</p>\n\n<p>Vous pouvez acc&eacute;der, si besoin, aux archives de toutes les entit&eacute;s.</p>\n\n<p>Pour y acc&eacute;der, un raccourci a&nbsp;&eacute;t&eacute; cr&eacute;&eacute; dans le r&eacute;pertoire &quot;Z:\\2_Archives&quot; de chaque agence. (arborescence finale)</p>\n\n<p><span style=\"color:#FF0000\"><strong>IMPORTANT : </strong></span>Vu que les archives ont &eacute;t&eacute; centralis&eacute;es, merci de faire attention &agrave; ne pas recopier les dossiers en entier sur votre partage local. Cette copie passera par votre liaison internet et&nbsp;en fonction du volume,&nbsp;la dur&eacute;e de transfert pourra &ecirc;tre plus ou moins longue.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Concernant les modalit&eacute;s de passage en archive :</strong></p>\n\n<p>Une affaire est consid&eacute;r&eacute;e termin&eacute;e lorsque&nbsp;la derni&egrave;re facture est sold&eacute;e.<br />\nLe &quot;responsable&quot; de l&#39;affaire&nbsp;devra veiller &agrave; ce que le contenu du dossier informatique soit exhaustif&nbsp;(Donn&eacute;es de production, facturation scann&eacute;e, communication avec le client etc...) et le d&eacute;placera dans le dossier &quot;Z:\\_A_Archiver&quot;.</p>\n\n<p>La DSI se chargera de basculer ces donn&eacute;es sur le partage centralis&eacute; afin de sortir ces donn&eacute;es de votre partage et des sauvegardes quotidiennes.</p>\n\n<p>Un PROCESS qualit&eacute; est en cours de r&eacute;daction et formalisera la proc&eacute;dure. (Acc&eacute;ssible dans un premier temps sur le N:\\)</p>','Archives',NULL),(3,'<p>Panne du serveur h&eacute;bergeant l&#39;IREEF</p>\r\n\r\n<p><iframe frameborder=\"0\" height=\"600\" scrolling=\"no\" src=\"https://www.google.com/maps/d/u/0/embed?mid=zKbvCJ-EBI40.kus0fHAc15jI\" width=\"100%\"></iframe></p>','Information',NULL),(7,'<p><u><strong>Gestion des Softs :</strong></u><br />\r\n-&nbsp;D&eacute;ploiement sur les postes de travail de l&#39;antivirus Symantec EndPoint : <span style=\"color:#008000\">Termin&eacute;</span><br />\r\n-&nbsp;Mise en place de Landesk (prise en main et inventaire logiciels) : <span style=\"color:#008000\">Termin&eacute;</span><br />\r\n- Mutualisation des licences AutoDESK en r&eacute;seau V2016 : <span style=\"color:#FF8C00\">Serveur de licence install&eacute;, images 2016 en cours de d&eacute;ploiement</span><br />\r\n- Mutualisation des licences Bentley en r&eacute;seau V8i : <span style=\"color:#FF8C00\">Packages d&#39;installation en cours de pr&eacute;paration</span><br />\r\n<br />\r\n<strong><u>Messagerie :</u></strong><br />\r\n-&nbsp;Mise en place de la messagerie sous Exchange 365 : <span style=\"color:#FF8C00\">En cours</span><br />\r\n&gt; Reste le site de <span style=\"color:#FF0000\">Beaune </span>(contraintes techniques)</p>\r\n\r\n<p><u><strong>Serveurs&amp;Arborescences :</strong></u><br />\r\n- Angoul&ecirc;me : <span style=\"color:#FF8C00\">En cours de migration (90%)</span><br />\r\n- Aubi&egrave;re :&nbsp;&nbsp;Migration&nbsp;<span style=\"color:rgb(0, 128, 0)\">termin&eacute;e</span>&nbsp;; Arborescence en&nbsp;<span style=\"color:rgb(255, 0, 0)\">standby&nbsp;</span>(contraintes techniques)<br />\r\n- Beaune : Migration <span style=\"color:#008000\">termin&eacute;e</span>&nbsp;; Arborescence en <span style=\"color:#FF0000\">standby&nbsp;</span>(contraintes techniques)<br />\r\n- Biot : Migration <span style=\"color:#008000\">termin&eacute;e</span><br />\r\n- Boulogne : Migration<span style=\"color:#008000\"> termin&eacute;e</span><br />\r\n- Brest : <span style=\"color:#FFA500\">En cours de migration (90%)</span><br />\r\n- Bron : Migration&nbsp;<span style=\"color:rgb(0, 128, 0)\">termin&eacute;e</span><br />\r\n- BronEnergie : Migration<span style=\"color:rgb(0, 128, 0)\"> termin&eacute;e ;</span>&nbsp;Arborescence en&nbsp;<span style=\"color:rgb(255, 0, 0)\">standby&nbsp;</span>(contraintes techniques)<br />\r\n- Dijon :&nbsp;Migration&nbsp;<span style=\"color:rgb(0, 128, 0)\">termin&eacute;e</span><br />\r\n- Ecuisses : Migration&nbsp;<span style=\"color:rgb(0, 128, 0)\">termin&eacute;e</span><br />\r\n- Laval : &nbsp;<span style=\"color:rgb(255, 140, 0)\">En cours de migration (5%)</span><br />\r\n- Lorient : <span style=\"color:#FF8C00\">En cours de migration (5%)</span><br />\r\n- Paris : Migration&nbsp;<span style=\"color:rgb(0, 128, 0)\">termin&eacute;e</span><br />\r\n- Rennes : Migration <span style=\"color:rgb(0, 128, 0)\">termin&eacute;e&nbsp;</span>; <span style=\"color:#FF8C00\">Arborescence en cours (80%)</span><br />\r\n- Saintes : Migration <span style=\"color:rgb(0, 128, 0)\">termin&eacute;e</span><br />\r\n- St Herblain :&nbsp;<span style=\"color:rgb(255, 0, 0)\">A Faire ;&nbsp;</span>Arborescence&nbsp;<span style=\"color:rgb(0, 128, 0)\">termin&eacute;e</span><br />\r\n- St Malo :&nbsp;Migration&nbsp;<span style=\"color:rgb(0, 128, 0)\">termin&eacute;e</span><br />\r\n- Woippy :&nbsp;Migration&nbsp;<span style=\"color:rgb(0, 128, 0)\">termin&eacute;e</span></p>\r\n\r\n<p><u><strong>Archivage :</strong></u><br />\r\n- Process Global&nbsp;:&nbsp;<span style=\"color:rgb(0, 128, 0)\">Termin&eacute;</span><br />\r\n- Moyen mat&eacute;riels mis en oeuvre : <span style=\"color:#008000\">Termin&eacute;</span><br />\r\n- Rappatriement des datas sur Nantes : <span style=\"color:#FF0000\">En cours de planification</span></p>\r\n\r\n<p><u><strong>Mat&eacute;riel :</strong></u><br />\r\n- Commande de postes : <span style=\"color:#FF8C00\">En cours de pr&eacute;paration</span><br />\r\n- D&eacute;ploiement onduleurs&amp;parafoudres : <span style=\"color:#FF8C00\">En cours</span></p>\r\n\r\n<p><strong><u>Intranet :</u></strong><br />\r\n-&nbsp;Mise en place de l&#39;Intranet pr&eacute;vue pour courant Mars 2016<br />\r\n- V1 <span style=\"color:#FF8C00\">en cours</span> de finalisation pour tests sur Bron et Rennes</p>\r\n\r\n<p><strong><u>Visioconf&eacute;rence :</u></strong><br />\r\n-&nbsp;Remplacement progressive des solutions logicielles Jabber et RPD par un acc&egrave;s aux deux salles Capitole via le navigateur Chrome.<br />\r\n<span style=\"color:#FF8C00\">- Test en cours de r&eacute;alisation</span></p>\r\n\r\n<p><strong><u>S&eacute;curisation des acc&egrave;s internet :</u></strong><br />\r\n<span style=\"color:#008000\">- En production depuis le 16/03/2016</span></p>\r\n\r\n<p><strong><u>Partage documentaire :</u></strong><br />\r\n-&nbsp;Acc&egrave;s via http://partage.groupe-nox.com<br />\r\n<span style=\"color:#FF8C00\">- Test en cours de r&eacute;alisation</span> / Demande de compte &agrave;&nbsp;s.jubeau@groupe-nox.com</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n</ul>','AvancementProjet',NULL),(8,'<p>Vous trouverez dans cette partie un gestionnaire de comp&eacute;tences.</p>\n\n<p>Chaque agence met &agrave; disposition un document PDF r&eacute;sumant les comp&eacute;tences de ses collaborateurs et les personnes &agrave;</p>\n\n<p>contacter en cas de besoin.</p>\n\n<p>La proc&eacute;dure de cr&eacute;ation du document est disponible dans Ressources \\ FAQ.</p>','Competences',NULL),(10,'<p style=\"margin-left:40px\"><a href=\"http://groupe-nox.com/\" target=\"_blank\"><span style=\"color:#1F4E79\"><span style=\"font-size:24px\">Site du Groupe NOX</span></span></a></p>\r\n\r\n<p style=\"margin-left:40px\"><a href=\"https://login.microsoftonline.com/\" target=\"_blank\"><span style=\"color:#1F4E79\"><span style=\"font-size:24px\">WebMail</span></span></a></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"color:#1F4E79\"><strong><span style=\"font-size:24px\">Partage</span></strong></span></p>\r\n\r\n<p style=\"margin-left:80px\"><span style=\"font-size:20px\"><a href=\"https://360.autodesk.com/Login\" target=\"_blank\"><span style=\"color:#1F4E79\">A360 Drive</span></a></span></p>\r\n\r\n<p style=\"margin-left:80px\"><span style=\"font-size:20px\"><a href=\"https://groupenox.autodesk360.com/\" target=\"_blank\"><span style=\"color:#1F4E79\">A360 Team</span></a></span></p>\r\n\r\n<p style=\"margin-left:80px\"><span style=\"font-size:20px\"><a href=\"https://onedrive.live.com/about/fr-fr/\" target=\"_blank\"><span style=\"color:#1F4E79\">OneDrive</span></a></span></p>\r\n\r\n<p style=\"margin-left:80px\"><span style=\"font-size:20px\"><a href=\"https://www.wetransfer.com/\" target=\"_blank\"><span style=\"color:#1F4E79\">WeTransfer</span></a></span></p>\r\n\r\n<p style=\"margin-left:80px\"><a href=\"http://partage.groupe-nox.com/\" target=\"_blank\"><span style=\"font-size:20px\"><span style=\"color:#1F4E79\">Partage de document NOX</span></span></a></p>','Liens',NULL),(11,'<p style=\"margin-left:40px\"><a href=\"http://192.168.35.218/Symfony/web/uploads/References/M%C3%83%C2%A9thodologie%20R%C3%83%C2%A9f%C3%83%C2%A9rences.pdf\" target=\"_blank\"><span style=\"color:#1F4E79\">M&eacute;thodologie R&eacute;f&eacute;rences</span></a></p>','References',NULL),(33,'<p>sqdsqd</p>','Edito','2016-02-17'),(34,'<p>gfgfdgfdgfdgfdgfd</p>','Edito','2016-02-17'),(35,'<p style=\"text-align: center;\"><span style=\"font-size:28px\"><span style=\"color:#5882fa\">Intranet en d&eacute;veloppement</span></span></p>','Edito','2016-02-17'),(36,'<p style=\"text-align:center\"><span style=\"font-size:28px\"><span style=\"color:#5882fa\">Intranet en d&eacute;veloppement</span></span></p>','Edito','2016-02-17'),(37,'<p>&quot; <strong>Ne &nbsp;l&eacute;sinez jamais sur&nbsp;la Qualit&eacute;&nbsp;. Peu de gens ont l&#39;habitude d&#39;un environnement o&ugrave; l&#39;excellence est la norme.</strong>&quot; Steve JOBS</p>','Citations','2016-02-18'),(38,'<p style=\"text-align:center\"><span style=\"font-size:28px\"><span style=\"color:#5882fa\">Intranet en d&eacute;veloppement</span></spa